import Header from '../components/header';

// Wrapp the aplication with the navigation Provider passing down the current page slug.
const Home = () => {
  return (
    <div id="wrapper">
      <Header>
        <nav>
          <Link href="/"><a>Page One</a></Link>
          <Link href="/"><a>Page Two</a></Link>
        </nav>
      </Header>
      <Slider />
    </div>
  )
}

export default Home;
